import React from 'react';
import './Contact.css'; // Import custom CSS for Contact page styling

const Contact = () => {
  return (
    <div className="contact-container">
      <h2>Contact Me</h2>
      <div className="horizontal-line"></div><br></br>
    
    </div>
  );
};

export default Contact;
